import React, { Component } from "react";

class Dashboard extends Component {
	render() {
		return (
			<div className="container">
				<div className="row">
					<div className="col-12">
						<h1>Dashboard</h1>
					</div>
				</div>
			</div>
		);
	}
}

export default Dashboard;
